import React from "react";
import HeadComponent from "./components/Head";
import Head from 'next/head'
import Body from "./components/Body";

class Index extends React.Component {
  render() {
    return(
        <div>
           <Head>
            <HeadComponent/>
            </Head>
            <Body/>
        </div>
    )
  }
}

export default Index;
